// src/components/TutoringHistory.js
import React from 'react';
import { Box, Typography, Paper } from '@mui/material';
import Sidebar from './Sidebar';
import { styled } from '@mui/material/styles';

const TutoringHistory = () => {
  return (
    <Box sx={{ display: 'flex', minHeight: '100vh', backgroundColor: '#1e1e1e' }}>
      <Sidebar />
      <Box component="main" sx={{ flexGrow: 1, p: 3, backgroundColor: '#2c2c2c', color: '#fff' }}>
        <StyledPaper>
          <Typography variant="h4">Tutoring History</Typography>
          <Typography variant="body1" sx={{ mt: 2 }}>
            Here you can see the history of your tutoring sessions.
          </Typography>
          {/* Add additional content related to tutoring history here */}
        </StyledPaper>
      </Box>
    </Box>
  );
};

const StyledPaper = styled(Paper)({
  padding: '20px',
  marginBottom: '20px',
  backgroundColor: '#333',
  color: '#fff',
  borderRadius: '8px',
  boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
});

export default TutoringHistory;
